import React, { useEffect, useState, useRef } from "react";
import {
  GoogleMap,
  useLoadScript,
  Polyline,
  Polygon,
  Autocomplete
} from "@react-google-maps/api";
import boundaryGeoJSON from "./boundary.js"; // Adjust the path as per your project structure
import { REACT_APP_GOOGLE_MAPS_KEY } from "../constants/constants";

const getRandomColor = () => {
  // Generate random color in hexadecimal format
  const letters = "0123456789ABCDEF";
  let color = "#";
  for (let i = 0; i < 6; i++) {
    color += letters[Math.floor(Math.random() * 16)];
  }
  return color;
};

const MapComponent = ({ selectedLocation }) => {
  const { isLoaded, loadError } = useLoadScript({
    googleMapsApiKey: REACT_APP_GOOGLE_MAPS_KEY,
    libraries: ["places"],
  });

  const [geoJsonData, setGeoJsonData] = useState(null);
  const [selectedPlace, setSelectedPlace] = useState(null);
  const autocompleteRef = useRef(null);
  const mapRef = useRef(null);

  useEffect(() => {
    // Simulate loading GeoJSON data (replace with actual fetch or import)
    setTimeout(() => {
      setGeoJsonData(boundaryGeoJSON);
    }, 1000);
  }, []);

  useEffect(() => {
    if (selectedPlace && selectedPlace.geometry) {
      const bounds = new window.google.maps.LatLngBounds();
      bounds.union(selectedPlace.geometry.viewport);
      mapRef.current.fitBounds(bounds);
    }
  }, [selectedPlace]);

  const mapContainerStyle = {
    width: "100%",
    height: "100%",
  };

  const center = {
    lat: selectedLocation.lat || 17.385044, // Default to Hyderabad's center if selectedLocation is not available
    lng: selectedLocation.lng || 78.486671,
  };

  const zoom = 10;

  if (loadError) return "Error loading maps";
  if (!isLoaded) return "Loading maps";

  const onPlaceChanged = () => {
    const place = autocompleteRef.current.getPlace();
    if (place.geometry) {
      setSelectedPlace(place);
    } else {
      console.log("Place has no geometry");
    }
  };

  return (
    <div style={{ height: "100%", width: "100%" }}>
      <Autocomplete onLoad={(ref) => (autocompleteRef.current = ref)} onPlaceChanged={onPlaceChanged}>
        <input type="text" placeholder="Search for a place" style={{ width: "100%", padding: "10px" }} />
      </Autocomplete>
      <GoogleMap
        mapContainerStyle={mapContainerStyle}
        center={center}
        zoom={zoom}
        onLoad={(map) => (mapRef.current = map)}
      >
        {geoJsonData &&
          geoJsonData.features.map((feature, index) => {
            const randomColor = getRandomColor();
            
            if (feature.geometry.type === 'LineString') {
              const paths = feature.geometry.coordinates.map((coord) => ({
                lat: coord[1],
                lng: coord[0],
              }));

              return (
                <React.Fragment key={index}>
                  <Polyline
                    path={paths}
                    options={{
                      strokeColor: randomColor,
                      strokeOpacity: 0.8,
                      strokeWeight: 2,
                    }}
                  />
                </React.Fragment>
              );
            }

            if (feature.geometry.type === 'Polygon') {
              const paths = feature.geometry.coordinates[0].map((coord) => ({
                lat: coord[1],
                lng: coord[0],
              }));

              return (
                <React.Fragment key={index}>
                  <Polygon
                    paths={paths}
                    options={{
                      strokeColor: randomColor,
                      strokeOpacity: 0.8,
                      strokeWeight: 2,
                      fillColor: randomColor,
                      fillOpacity: 0.35,
                    }}
                  />
                </React.Fragment>
              );
            }

            return null;
          })}
        {selectedPlace && selectedPlace.geometry && selectedPlace.geometry.viewport && (
          <Polygon
            paths={[
              { lat: selectedPlace.geometry.viewport.getNorthEast().lat(), lng: selectedPlace.geometry.viewport.getNorthEast().lng() },
              { lat: selectedPlace.geometry.viewport.getNorthWest().lat(), lng: selectedPlace.geometry.viewport.getNorthWest().lng() },
              { lat: selectedPlace.geometry.viewport.getSouthWest().lat(), lng: selectedPlace.geometry.viewport.getSouthWest().lng() },
              { lat: selectedPlace.geometry.viewport.getSouthEast().lat(), lng: selectedPlace.geometry.viewport.getSouthEast().lng() }
            ]}
            options={{
              strokeColor: "#FF0000",
              strokeOpacity: 0.8,
              strokeWeight: 2,
              fillColor: "#FF0000",
              fillOpacity: 0.35,
            }}
          />
        )}
      </GoogleMap>
    </div>
  );
};

export default MapComponent;
